</iframe>
  }

  const modalList = [
    {id:"Psdsdffect",title:"second",url:"https://codepen.io/ash_s_west/pen/GRZbvym"},
    {id:"Pure-CSS-pulsing-button-effect",title:"Pure-CSS-pulsing-button-effect",url:"https://codepen.io/ash_s_west/pen/RwRejrb"},
    {id:"Pure-CSS-sdsdsdg-button-effect",title:"second",url:""},
    {id:"Puresdsssssssss-CSS-pulsing-button-effect",title:"third"},
  ]


    return <div id="codepens">

      {modalList.map((item,index) => 
        <div key={index}>
          <Modal info={item} content={iFrame}/>
        </div>)
      }

      {/* <script defer src="/static/scripts/modelIframe.js"></script> */}

    </div>
}
